select 'dashboard_used1y' as indicator, count(*)::varchar as value, (100*count(*)/(select count(*) from dashboard))||'%' as percent, 'Dashboards that have not been opened in the last 12 months' as description from
 dashboard where not uid in (select favoriteuid
 from datastatisticsevent where eventtype =
 'DASHBOARD_VIEW' and favoriteuid is not null
 and timestamp > (now() - INTERVAL '12 months')
 group by favoriteuid);

SELECT uid,name from dashboard where not uid in (select favoriteuid from datastatisticsevent where eventtype = 'DASHBOARD_VIEW' and favoriteuid is not null
 and timestamp > (now() - INTERVAL '12 months')
 GROUP BY favoriteuid);
